import { createContext } from 'react';
import SectionsManager from './SectionsManager';


function App() {

  const MyContext = createContext();

  return (
    <MyContext.Provider >
      <div className="App">
        <SectionsManager />
      </div>
    </ MyContext.Provider >
  );
}

export default App;
